restrainPlayableArea.body:
var moveX = position[0];
var moveY = position[1];
var highArea = 0;
var lowArea = canvasSize[1]/2;
var leftArea = 0;
var rightArea = canvasSize[0];

// haut
if (moveY < highArea)
  moveY = highArea;
  //moveY = moveY;
// bas
if (moveY > (lowArea - assetSize[1]))
  moveY = lowArea - assetSize[1];
  //moveY = moveY;
// gauche
if (moveX < leftArea)
  //moveX=leftArea;
  moveX = moveX;
// droit
if (moveX > (rightArea - assetSize[0]))
  moveX = rightArea - assetSize[0];
  //moveX = moveX;

return [moveX,moveY];

moveKeyboardPlusVector.body:
var moveX = position[0] - vector;
var moveY = position[1];

// haut
if(keysDown["38"])
  moveY = moveY - 2;
// bas
if(keysDown["40"])
  moveY = moveY + 2;
// gauche
if(keysDown["37"])
  moveX = moveX - 0.5;
// droite
if(keysDown["39"])
  moveX = moveX + 0.5;

return [moveX,moveY];
